function add(a, b){
    return a+b;
}
function sub(a, b){
    return a-b;
}
function mult(a, b){
    return a*b;
}
function div(a, b){
    return a/b;
}
function Calculator(){
    return <ol>
        <li>Addition: {add(4, 3)}</li>
        <li>Subtraction: {sub(4, 3)}</li>
        <li>Multiplication: {mult(4, 3)}</li>
        <li>Divide: {div(4, 2)}</li>
    </ol>
    
}

export default Calculator;
